import styles from "./Home.module.css";
const Login = ({props}) => {

  return (
    <div className={styles.container}>
      <div className={styles.homeNav}>

      <div className={styles.netra}>
        <img src="/netra-logo-removebg.png" width={200} height={200} />
        <div>NETRA</div>
      </div>
    </div>
    </div>
  );
};

export default Login;
